政职业能力测验	定价：	42.00 \r\n2019贵州省公务员录用考试专用教材：公共基础知识定价：45.00 \r\n\r\n2019贵州省公务员录用考试专用教材：全真模拟预测试卷公共基础知识定价：32.00  \r\n总定价：342.00 元 ',0,''),(6,109,'2019国家公务员考试用书2018申论 ','28','','《中公版·2019国家公务员录用考试专业教材：申论》分为\"申论基础-五大题型-热点政策-实战模拟\"四篇内容，并提供了学习申论的几大\"神器\"：\r\n　　1.视听学练一体：视频+课程+图书讲解+热点资料+真题模拟练习+申论批改+在线课堂的学习体验，提升备考效率。\r\n　　2.图文并茂讲解：考情分析搭配可视化图表，题型特点及命题趋势一目了然；真题精解配合思维导图，分解步骤，方法科学，易学易用。\r\n　　3.政策解读与应用：报告、\"十三五\"规划纲要，新提法、新亮点、关键词科学解读，政策应用举例，我们带领你开启轻松学模式。\r\n　　4.申论真题精解：材料+批注，思路清晰，要言不烦，手把手教你阅读材料，提取要点，变身申论\"达人\"。\r\n　　5.解题实用攻略：本书紧随国考趋势，解读变化、网罗考点，教你一眼辨清题型，快速搭建作答框架，将理论落实到笔头。',222,'https://img11.360buyimg.com/n1/s200x200_jfs/t18079/218/110880096/259316/1d155d01/5a5d61b7N8a328cbe.jpg','《中公版·2019国家公务员录用考试专业教材：申论》分为\"申论基础-五大题型-热点政策-实战模拟\"四篇内容，并提供了学习申论的几大\"神器\"：\r\n　　1.视听学练一体：视频+课程+图书讲解+热点资料+真题模拟练习+申论批改+在线课堂的学习体验，提升备考效率。\r\n　　2.图文并茂讲解：考情分析搭配可视化图表，题型特点及命题趋势一目了然；真题精解配合思维导图，分解步骤，方法科学，易学易用。\r\n　　3.政策解读与应用：报告、\"十三五\"规划纲要，新提法、新亮点、关键词科学解读，政策应用举例，我们带领你开启轻松学模式。\r\n　　4.申论真题精解：材料+批注，思路清晰，要言不烦，手把手教你阅读材料，提取要点，变身申论\"达人\"。\r\n　　5.解题实用攻略：本书紧随国考趋势，解读变化、网罗考点，教你一眼辨清题型，快速搭建作答框架，将理论落实到笔头。',0,''),(7,110,'中公教育2019国家公务员面试快速突破系列教材国考面试结构化面试教程','30','','',333,'https://img13.360buyimg.com/n1/s200x200_jfs/t1/2461/34/15642/201381/5bdfc98eEf4264ac4/4b8366b74dc8b05f.jpg','《中公版·2019公务员面试快速突破系列教材：结构化面试教程》在具体内容编排上共分为五篇：\r\n第一篇为夯实基础篇，简要介绍结构化面试基础理论，新增结构化小组面试解读，系统分析结构化面试考情；\r\n第二篇为专项突破篇，从题型概述、答题指导、真题精讲、巩固训练四个方面为考生详细讲解时政热点类、哲理思辨类、组织活动类、情境处理类、人际处理类、人岗匹配类、言语表达类、反驳题、材料题、漫画题等结构化面试题型。\r\n第三篇为实战能力提升篇，包括考场突发情况处理指导、结构化面试礼仪指导、面试心理调适指导、公务员思维和面试言语表达指导。同时，提供高、中、低三等答题展示，并针对如何实现去模式化答题，从审题、答题两个层面进行了详细讲授。\r\n第四篇为实战演练篇，为考生选取部分2018年国家公务员结构化面试及地方结构化面试部分真题进行展示与讲解。\r\n第五篇为热点积累篇，既有对2018年国家大政方针的解读，也有对公务员面试十个热点专题的讲解。',0,''),(1448,463,'过桥米线','4.5','桶','',999,'https://img.alicdn.com/imgextra/i1/2335284926/TB24CyOtZj_B1NjSZFHXXaDWpXa_!!2335284926.jpg_430x430q90.jpg','',1,''),(1449,463,'重庆小面','5','桶','',999,'https://img.alicdn.com/imgextra/i2/2645124890/TB2kNe4atfJ8KJjy0FeXXXKEXXa_!!2645124890.jpg_430x430q90.jpg','',1,''),(1450,463,'火鸡面','6','桶','',999,'https: